import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Provider } from 'react-redux';
import { store } from './store';
import { db } from './services/database';

// Simple test components
const TestHome: React.FC = () => (
  <div className="p-8">
    <h1 className="text-2xl font-bold">Home - Working!</h1>
    <p>Basic route is working correctly.</p>
  </div>
);

const TestJobs: React.FC = () => (
  <div className="p-8">
    <h1 className="text-2xl font-bold">Jobs - Working!</h1>
    <p>Jobs route is working correctly.</p>
  </div>
);

const TestCandidates: React.FC = () => (
  <div className="p-8">
    <h1 className="text-2xl font-bold">Candidates - Working!</h1>
    <p>Candidates route is working correctly.</p>
  </div>
);

const AppRoutes: React.FC = () => {
  return (
    <Routes>
      <Route path="/" element={<TestHome />} />
      <Route path="/jobs" element={<TestJobs />} />
      <Route path="/candidates" element={<TestCandidates />} />
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
};

const App: React.FC = () => {
  const [isInitialized, setIsInitialized] = useState(false);

  useEffect(() => {
    const init = async () => {
      try {
        await db.open();
        console.log('Database initialized successfully');
        setIsInitialized(true);
      } catch (error) {
        console.error('Failed to initialize database:', error);
        setIsInitialized(true);
      }
    };
    
    init();
  }, []);

  if (!isInitialized) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <div className="w-16 h-16 border-4 border-blue-600 border-t-transparent rounded-full animate-spin mx-auto mb-4"></div>
          <p className="text-gray-600">Initializing TalentFlow...</p>
        </div>
      </div>
    );
  }

  return (
    <Provider store={store}>
      <Router>
        <div className="min-h-screen bg-gray-50">
          <AppRoutes />
        </div>
      </Router>
    </Provider>
  );
};

export default App;
